import React from "react";
import Axios from "axios";

import { Grid, Label, Message, Table } from "semantic-ui-react";

class Dashboard extends React.Component {
  state = {
    assignments: [
      {
        heading: "Write about your trip to England",
        text: "",
        doc: "",
        dos: ""
      },
      {
        heading: "Write about your trip to England",
        text: "",
        doc: "",
        dos: ""
      },
      {
        heading: "Write about your trip to England",
        text: "",
        doc: "",
        dos: ""
      }
    ]
  };

  getActiveAssignments = () => {};

  renderAssignment = assignment => {
    return <Table.Row>{assignment.heading}</Table.Row>;
  };

  renderAssignments = assignments => {
    return assignments.map(assignment => this.renderAssignment(assignment));
  };

  render = () => {
    return <Table celled><Table.Body>{this.renderAssignments(this.state.assignments)}</Table.Body></Table>;
  };
}

export default Dashboard;
